
public class Degree {
	String name;
	Integer degree;
	public Degree() {
		super();
		// TODO Auto-generated constructor stub
	}
	public Degree(String name, Integer degree) {
		super();
		this.name = name;
		this.degree = degree;
	}
	public String getName() {
		return name;
	}
	public void setName(String name) {
		this.name = name;
	}
	public int getDegree() {
		return degree;
	}
	public void setDegree(Integer degree) {
		this.degree = degree;
	}
	
}
